import React, { useState } from "react";
import RatingsList from "./Components/RatingsList";
import VideoPlayer from "./Components/VideoPlayer";
import RatingForm from "./Components/RatingsForm";
import useFetchRatings from "./Components/useFetchRatings";

function App() {
  const [videoName, setVideoName] = useState("");
  const { ratings, fetchRatings } = useFetchRatings();

  return (
    <div>
      <h1>Random Keyboard Sounds</h1>
      <h2>{videoName}</h2>
      <VideoPlayer setVideoName={setVideoName} />
      <RatingForm videoName={videoName} fetchRatings={fetchRatings} />
      <RatingsList ratings={ratings} fetchRatings={fetchRatings} />
    </div>
  );
}

export default App;
